tables.table_schema:
CREATE TABLE KeyPermissions (
    id INT PRIMARY KEY,
    key_id INT,
    user_id INT,
    permission_type VARCHAR(50)
);

CREATE TABLE quantum_users (
  user_id INT PRIMARY KEY,
  username VARCHAR(50) NOT NULL,
  email VARCHAR(100) NOT NULL,
  permission_level INT
);

CREATE TABLE quantum_cryptography_keys (
    key_id UUID PRIMARY KEY,
    key_value TEXT NOT NULL,
    owner_id UUID NOT NULL,
    usage_count INT DEFAULT 0
);

CREATE TABLE key_usage_logs (
    log_id UUID PRIMARY KEY,
    key_id UUID REFERENCES quantum_cryptography_keys(key_id),
    timestamp TIMESTAMP NOT NULL,
    action_type VARCHAR(20) NOT NULL,
    user_id UUID NOT NULL
);

CREATE TABLE key_permissions (
    permission_id UUID PRIMARY KEY,
    key_id UUID REFERENCES quantum_cryptography_keys(key_id),
    user_id UUID NOT NULL,
    permission_type VARCHAR(20) NOT NULL
);

CREATE TABLE key_owners (
    owner_id UUID PRIMARY KEY,
    owner_name TEXT NOT NULL,
    contact_info TEXT
);

CREATE TABLE key_audit_logs (
    audit_id UUID PRIMARY KEY,
    key_id UUID REFERENCES quantum_cryptography_keys(key_id),
    timestamp TIMESTAMP NOT NULL,
    event_type VARCHAR(20) NOT NULL
);
